import React from 'react';
import Card from 'react-bootstrap/Card'

class VideoCard extends React.Component {
    constructor(props) {
        super();
        this.state = {
            name: '',
            link: '',
            category: '',
            author: ''
        };
    }
    render() {
        return (
            <ul>
                <Card style={{ width: '18rem' }}>
                    <Card.Body>
        <Card.Title>{this.state.name}</Card.Title>
                        <Card.Text>
                           {this.state.link}
                        </Card.Text>
                    </Card.Body>
                </Card>
            </ul>
        );
    }
}

export default VideoCard;
